Chapter 1 1 UPawulos, umpostile kaYesu Kristu, obizwe ngokuthanda kukaThixo, noSostenes umzalwana, 2 ubhalela ibandla likaThixo eliseKorinte, abangcwaliselwe kuKristu Yesu, ababizwe ukuba babe ngcwele, kunye nabo bonke abalinqulayo igama leNkosi yethu uYesu Kristu ezindaweni zonke, ezabo kwanezethu: 3 uthi, Makube lubabalo kuni, noxolo oluvela kuThixo uBawo wethu, neNkosi yethu uYesu Kristu. 4 Ndihlala ndibulela kuye uThixo wam ngani, ngenxa yobabalo lukaThixo, awanibabala ngalo nikuKristu Yesu;
..........
ptiza wumbi. 17 Kuba uKristu akandithumanga kubhaptiza; wandithuma ukushumayela iindaba ezilungileyo, kungabi ngabulumko bakuthetha, ukuze umnqamlezo kaKristu ungalanjathiswa. 18 Kuba ilizwi lomnqamlezo libubudenge okunene kwabatshabalalayo; kodwa ke kwabasindiswayo, thina aba, lingamandla kaThixo. 19 Kuba kubhaliwe kwathiwa, Ndiya kubutshabalalisa ubulumko bezilumko, Ingqondo yeengqondi ndiyitshitshise. 20 Siphi na ke isilumko? Uphi na ke umbhali? Uphi na ke umphiki weli phakade? UThixo akabenz

Chapter 3 1 Nyana wam, musa ukuwulibala umyalelo wam; Intliziyo yakho mayiyibambe imithetho yam; 2 Kuba iya kukongeza imihla emide, Neminyaka yobomi, noxolo. 3 Inceba nenyaniso mayingakushiyi; Zinxibe kuwe emqaleni; Zibhale elucwecweni lwentliziyo yakho, 4 Ubabalwe ube nengqiqo entle Emehlweni kaThixo nawabantu. 5 Kholosa ngoYehova ngentliziyo yakho yonke, Ungayami okwakho ukuqonda. 6 Uze umazi yena ezindleleni zakho zonke; Wowulungelelanisa umendo wakho. 7 Musa ukuba sisilumko kwawakho amehlo; 
..........
obomi kwababambelela kubo, Unoyolo obubambayo. 19 UYehova waliseka ihlabathi ngobulumko, Walizinzisa izulu ngengqondo. 20 Agqobhoka amanzi anzongonzongo ngokwazi kwakhe, Savuza umbethe isibhakabhaka. 21 Nyana wam, ezi nto mazingemki emehlweni akho: Londoloza uzimaso nomnkqangiyelo. 22 Zoba bubomi emphefumlweni, Nento entle emqaleni wakho. 23 Uya kwandula uhambe ngendlela yakho ukholosile. Lungabetheki unyawo lwakho. 24 Ukuba uthe walala, akuyi kunkwantya; Wolala, bube mnandi ubuthongo bakho. 25
